import React from 'react'
import Video from '../../Videos/TeamVB.mp4'
import{
    TemaContainer,
    VdoBG,
    TeamBG
} from './TeamElements'


const Team = () => {
    return (
        <>
            <TemaContainer>
                <TeamBG>
                    <VdoBG autoPlay loop muted src={Video} type='video/mp4'/>
                </TeamBG>
            </TemaContainer>  
        </>
    )
}

export default Team
